window.bookSummaryJSON = "<p>One woman, determined to stay single for life…</p> <p>Meets two Kindred warriors looking for a mate.</p> <p>When they visit a famous alien artist looking for a Muse</p> <p>Will Lili end up</p> <p>Posing for Their Pleasure?</p> <p>Tropes—MFM, They Fall First, Touch her and Die, Fated Mates, Curvy FMC, Forced Proximity</p> <p>**This is a STAND ALONE novel set in the Kindred Universe</p> <p>Lilibet Trainer is SFL—Single For Life. After getting away from a horrible husband she’s decided to go it on her own. But when an attacker chases her into the arms of two huge Kindred warriors, will she change her mind?</p> <p>Fights Darkness and Treads Lightly—Dark and Light for short—are visiting Earth for the first time. Because emotions are punishable by death on their home world of Z4, they are just now starting to have feelings. And seeing the curvy Lili being chased by an attacker definitely brings up all kinds of new emotions—namely the desire to protect and possess her.</p> <p>Not wanting to let the curvy little human go, Light and Dark volunteer to take Lili on a trip to visit a famous alien art collector. But when the collector suggests that the three of them make some art together, will Lili end up…Posing for their Pleasure?</p> <p>Author's Note—my FMC gets into some sticky situations that may upset anyone who has ever been attacked in the past but I promise it all works out in the end. Please Listen Responsibly</p> <p>Hugs, Evangeline</p>"; 
